import React, {useState} from "react";
import { Page, Document } from 'react-pdf/dist/esm/entry.webpack';
import Index from "./app/index";
import Lection from "./app/lection";
import LectionPage from "./app/lectionPage";
import Practice from "./app/practice";
import {Routes, Route, BrowserRouter} from "react-router-dom";

function App() {

  const [numPage, SetNumPage] = useState(null)
  const [numNumber, SetNumNumber] = useState(1)

  function onDocumentLoadSuccess({numPage}){
    SetNumPage(numPage);
    SetNumNumber(1);
  };

  return (
    <BrowserRouter>
      <Routes>
        <Route path='/' element={<Index />}/>
        <Route path="/lection" element={<Lection />}/>
        <Route path="/lection/:id" element={<LectionPage />}/>
        <Route path="/practice" element={<Practice />}/>
      </Routes>
    </BrowserRouter>
  );
}

export default App;
